CB(3,"Permanent crop & watercress copying","You unlocked your first permanent type of plant.","You unlocked your first permanent type of plant. Plants like this don't wither, keep producing forever, and have much more powerful production upgrades too.<br><br>Watercress also remains useful: if you plant a watercress next to permanent plants, the watercress copies all its neighbors' production (orthogonally, not diagonally). If there is more than 1 watercress in the entire field they copy less, so having 1 or perhaps 2 max makes sense (by design: no need to replant many watercress all the time. Check the seeds/s income to experiment). The watercress is its own independent multiplier so it works well and is relevant no matter how high level other boosts the permanent plants have later in the game.<br><br>TIP: press \"p\" to plant last used crop type at mouse cursor, or shift+click for the same effect, or ctrl (or command) + click to plant watercress. More shortcuts are listed in the main game help menu.",
void 0,"<br><br>The image below shows an optimal configuration to use for watercress copying: the single watercress duplicates the production of 4 blackberries:",[[void 0,Vc[4],void 0],[Vc[4],Rd[4],Vc[4]],[void 0,Vc[4],void 0]]);
CB(19,"Mushrooms","You unlocked your first type of mushroom","You unlocked your first type of mushroom. Mushrooms produce spores, but they consume seeds. Mushrooms must touch berries to get their seeds. If the berry cannot produce enough seeds for the mushroom, the mushroom produces less spores. If the berry produces more seeds than needed, the remaining seeds go to the regular seeds stack<br><br>Spores let the tree level up, unlocking next kinds of bonuses.<br><br>Spores are used by the tree, but the mushroom is not required to touch the tree.<br><br>The mushroom can (and should!) be boosted by flowers. This boosts its production, but also increases its seed consumption.<br><br>Leave some berries without mushrooms too, otherwise you won't get enough seed production for next upgrades and crops.",void 0,
"<br><br>The image shows a possible configuration for mushrooms: it extracts seeds from the berry it touches. In addition, both the mushroom and berry are boosted by flowers. In addition, there's another berry that doesn't touch a mushroom so that there's some production too",[[sd[4],Wc[4],void 0],[kd[4],kd[4],void 0],[Wc[4],kd[4],void 0]]);
CB(20,"Flowers","You unlocked your first type of flower","You unlocked your first type of flower. Flowers boost resource-producing crops such as berries and mushrooms, if planted next to them. It can boost all the 4 orthogonal neighboring crops.",void 0,"<br><br>The image shows a possible good configuration for flower boost: multiple flowers boost multiple berries. The center-most blackberry is receiving the boost 4 times.",[[Vc[4],kd[4],Vc[4]],[kd[4],Vc[4],kd[4]],[Vc[4],kd[4],Vc[4]]]);
CB(21,"Nettles","Unlocked a new crop: nettle. Nettle boosts mushrooms, but hurts flowers and berries it touches.","Unlocked a new crop: nettle. Nettle boosts mushrooms, but hurts flowers and berries it touches. The mushroom boost increases spore production without increasing seeds consumption. The boost is an additional multiplier independent from flower boost to mushroom, so having both a nettle and a flower next to a mushroom works even greater.",Pd[4],"<br><br>The image shows a possible configuration where the mushroom receives boost from both nettle (top) and flower (bottom). The top left flower and top right blackberry in this image however are negatively affected by the nettle.",
[[kd[4],Pd[4],Vc[4]],[Wc[4],sd[4],Wc[4]],[void 0,ld[4],void 0]]);CB(6,"Tree leveled up","Tree leveled up","Thanks to spores, the tree completely rejuvenated and is now a "+mf[qo(1)][0]+", level 1. More spores will level up the tree more. The tree can unlock abilities and more at higher levels. Click the tree in the field for more info.",void 0,void 0,[[void 0,mf[qo(1)][1][0]],[void 0,mf[qo(1)][2][0]]]);
