CB(2,"Tree dropped fruit","Tree reached level 5 and dropped a fruit",'The tree reached level 5 and dropped a fruit! Fruits provide boosts and can be upgraded with fruit essence. Essence is gained by sacrificing fruits, and all full amount of fruit essence can be used for upgrading all other fruits at the same time. See the "fruit" tab, it also has a more extensive help dialog for fruits.<br><br>A possible strategy: keep fruits with good abilities you like. Sacrifice any other surplus fruits, so you can use the essence to upgrade the good fruits.',tc[0]);
CB(18,"Tree dropped better fruit","Tree reached level 15 and dropped another fruit","The tree reached level 15 and dropped another fruit! It drops one every 5 levels. Fruits from higher tree levels have random probability to be of better, higher tier, types.",tc[2]);
CB(7,"Tree can transcend","Tree reached level 10 and it's now possible to transcend","The tree reached adulthood, and is now able to transcend! Click the tree in the field to view the transcension dialog. The tree also dropped another fruit, check the fruit tab whether you want to keep it since it's in the sacrificial pool for now.",void 0,void 0,[[void 0,mf[qo(10)][1][0]],[void 0,mf[qo(10)][2][0]]]);
CB(1,"Transcension","You performed your first transcension! You can use resin in the ethereal field tab.","You performed your first transcension! Check the new ethereal field tab, spend resin on ethereal plants for bonuses to your basic field. Get more resin by transcending again.",void 0,"<br><br>The following image shows an example of an ethereal field setup with several ethereal crops that give boosts to the main field: all types of basic field berries, mushrooms and flowers are boosted by this example. The image also shows a white lotus that boosts the neighboring ethereal crops to make their boosts even bigger.",
[[void 0,kd[4],void 0],[Vc[4],Xd[4],sd[4]],[void 0,Vc[4],void 0]]);CB(9,"Ethereal upgrades","You unlocked your first ethereal upgrade!",'You unlocked your first ethereal upgrade, thanks to planting an ethereal crop! Check the new "ethereal upgrades" tab to view this new type of upgrade. Ethereal upgrades cost resin, just like ethereal plants do, but ethereal upgrades are permanent and non-refundable, unlike ethereal crops which can be deleted give 100% refund');
CB(17,"Mistletoes","Unlocked a new crop: mistletoe","Unlocked a new crop: mistletoe. Mistletoe can be placed next to the basic field tree to create twigs, orthogonally, not diagonally. They produce twigs, which, like resin, you only actually get when transcending. Twigs help the ethereal field tree. However having more than one mistletoe increases the spore requirement for leveling the basic tree and slightly decreases resin gain, and more mistletoes give diminishing returns (but still increases it). Mistletoes that are not planted next to the tree do nothing at all.",
be[4],"<br><br>The image shows a possible configuration where mistletoes are next to the tree and thus give twigs on tree level up.",[[mf[qo(2)][1][0],be[4]],[mf[qo(2)][2][0],be[4]]]);
CB(22,"Ethereal tree leveled up","The ethereal tree leveled up, unlocking new ethereal upgrades, crops and boosts","Thanks to twigs, the ethereal tree leveled up! This is the tree in the ethereal field, not the one in the basic field. Leveling up the ethereal tree unlocks new ethereal crops and/or upgrades, depending on the level. Each level also provides a resin production boost to the basic tree.",void 0,void 0,[[void 0,mf[qo(1)][1][4]],[void 0,mf[qo(1)][2][4]]]);
CB(24,"Challenges","You unlocked a challenge!","You unlocked a challenge! Challenges can be accessed from the tree, as an alternative to regular transcension. All challenges give a production bonus (to seeds and spores, and a smaller amount to resin and twigs) for highest tree level reached. Challenges may also give one-time rewards for successfully reaching a certain level. Challenges can be ran as many times as desired, redoing them can increase the max level reached.",void 0);
CB(25,"Bee challenge",void 0,"You started the bee challenge! Rules are different from the standard game. You can click the tree at any time to view the current challenge rules, reward and stats. Plant some watercress or blackberry to get started.",ge[4],"<br><br>The image below shows a possible configuration for the bees: all workers touch a flower as required, queens optionally touch workers for extra boost (so beehives provide a boost-boost), and hives touch queens to make that boost stronger (a boost-boost-boost). More than 1 flower does not increase boost but multiple queens or hives do. The rightmost worker bee gives most boost because it touches 3 queens, and the topmost queen gives least boost since it touches the least hives. You can fill in gaps in the picture where more queens or hives would increase the boost more. Not shown in the picture is that you also need some mushroom and berry production running somewhere, which can also be boosted by flowers in the standard way.",
[[void 0,ee[4],ge[4],ce[4]],[ee[4],he[4],ee[4],ge[4]],[void 0,ee[4],ge[4],ce[4]],[void 0,ge[4],ce[4],void 0]]);CB(26,"Challenge completed","","The tree reached the challenge's target level, you can successfully complete the challenge and can get its main reward! You can complete the challenge from the tree dialog, or continue to reach a higher level for more challenge max-level bonus. You can also replay the challenge at any later time to increase the max level.",void 0);
CB(27,"Beehives","You unlocked beehives!","You unlocked beehives! Beehives boost orthogonally neighboring flowers, while flowers boost berries and mushrooms (beehives boost-boost). This adds a new independent multiplier that can be upgraded to the game.",ce[4],"<br><br>The image shows a possible configuration for beehives, such that the beehives boost flowers, which in turn boost berries and mushrooms. It's ensured both the mushroom and the berry it consumes from have a hive-boosted flower.",[[void 0,
ad[4],nd[4],ad[4]],[ad[4],nd[4],ce[4],nd[4]],[void 0,ad[4],nd[4],ad[4]],[void 0,ce[4],nd[4],wd[4]]]);
CB(28,"Automaton & Blueprints","You unlocked the automaton!",'You unlocked the automaton! You can place the automaton in the ethereal field. When placed, it gives a boost to neighbors, and the automaton tab and blueprints unlock, allowing to automate various parts of the game.<br><br>You must place the automaton in the ethereal field before this works, then go to the new automaton tab, and configure its settings before it actually automates anything.<br><br>More and more automation features become available later in the game.<br><br>When removing the automaton from the ethereal field, all automation features will be disabled, but they all come back the way they were when placing the automaton again.<br><br>The automaton initially has the following features unlocked:<br><br> \u2022 Blueprints and templates: Templates are translucent blue looking versions of crops that can be placed in the field using the regular planting menu. Blueprints can be created and placed from the blueprint button in the tree.<br> \u2022 Buttons to delete all crops in the main field or in the ethereal field: these are in the automaton tab and are for convenience. Deleting the ethereal field still uses tokens as usual.<br> \u2022 Automation of choice upgrades: Use the button in the automaton tab to enable/disable this. Use the "gear" button to set up which choice to make for which upgrade. You have to use the gear for the initial setup of this.<br> \u2022 Neighbor boost in the ethereal field: the automaton in the ethereal field gives an independent boost to neighbors, similar to lotuses.<br>',ne[4],
void 0,[[void 0,Ge[4],void 0],[Ge[4],ye[4],Ge[4]],[void 0,Ge[4],void 0]]);CB(29,"Auto upgrades","You unlocked auto upgrades!","You unlocked auto-upgrades for the automaton! See the automaton tab. You can enable or disable auto-upgrades, and choose a max cost the automaton is allowed to spend. All basic upgrades that boost crops, will be automatically performed by the automaton, at their normal cost, when enabled.",ne[4]);
CB(30,"Auto upgrades more options","You unlocked more auto upgrade options!",'You unlocked more finetuning options for the auto upgrades. See the automaton tab. There is now a "gear" button next to the auto upgrade button: you can now configure the max cost per crop type (berry, mushroom, flower, ...).',ne[4]);
CB(31,"Auto plant","You unlocked auto plant!","You unlocked auto-planting for the automaton! See the automaton tab. You can enable or disable auto-plant, and choose a max cost the automaton is allowed to spend.<br><br>How this works: the automaton will replace existing crops or blueprint templates with a higher tier, if that higher tier is unlocked. The automaton will not plant new crops from scratch, and will only replace crops or blueprint templates to the same type, e.g. berry to berry, flower to flower, ...<br><br>For example: If you have a blackberry, and now unlock blueberry, the automaton will automatically replace all planted blackberries in the field with blueberries, given enough resources.",ne[4]);
CB(32,"Auto plant more options","You unlocked auto plant more options!",'You unlocked more finetuning options for auto planting, you can now choose how many resources the automaton can spend on crops of each type. Use the "gear" button next to the auto-plant button to finetune these options',ne[4]);
CB(33,"Auto unlock","You unlocked auto-unlock!","You unlocked auto-unlock. This will unlock the next tiers of crops automatically. Combined with auto-plant and blueprint templates, this can almost fully automate a run.<br><br>Once you planted the general shape of your field with cheap crops or blueprint templates, everything will happen automatically from then on. Just place berries, mushrooms, flowers, nettles and beehives once to indicate the layout.<br><br>Tip: ensure there are some berries that don't touch a mushroom, because if a mushroom consumes all seeds of a berry, income will stop and the automaton won't get resources for further upgrades and planting, resulting in a deadlock.",ne[4]);
CB(34,"Multiplicity","You unlocked multiplicity! Mushrooms and berries boost each other no matter at what location.","You unlocked multiplicity! Berries now boost other berries just by having multiple anywhere field, and similarly, mushrooms boost mushrooms. This works across tiers, but max 1 tier higher or lower (e.g. blackberry affects blueberry, but it won't affect the 2-higher tier cranberry). For example, if there are 4 berry plants anywhere in the field, each berry receives a boost from the three others. Crops that are growing already fully count for multiplicity.",
Vc[4],void 0,[[Vc[4],void 0,Wc[4]],[void 0,void 0,void 0],[Wc[4],void 0,Vc[4]]]);
CB(35,"Squirrel & Nuts","You unlocked the squirrel and the nuts crops!","You unlocked the squirrel and the nuts crops! The squirrel gives an entirely new tech tree of ugrades. Place a squirrel in the ethereal field (it'll also boost neighbors!). Grow nuts in the main field using the new nuts crops. Use nuts to buy squirrel upgrades, in the new squirrel tab.\n    <br><br>\n    Nuts crops unlock at tree level 45, the first one is Almond. You can have max 1 nut crop in the main field, but it can be upgraded and replaced with better types. Nuts crops benefit from flowers, but only in a limited form independent of flower upgrades or bees, nuts crops are not affected by the same boosts as berries or mushrooms, they have their own more limited boosts. Watercress can copy from nuts, but only at half effectiveness and without fruit bonus.\n    <br><br>\n    Buy squirrel upgrades in the squirrel tab. Squirrel upgrades are laid out in a tech tree. Each next squirrel upgrade costs "+xt.toString()+
'x more than the previous one, no matter what order you do them in. Get higher tree levels and nut crops to get enough nuts for the next one.\n    <br><br>\n    You can respec the squirrel upgrades if you regret a decision, using a respec token. You get a few for free, more can be gotten for amber in the amber tab.\n    <br><br>\n    Once you ever respecced squirrel upgrades, the "buy all to here" option unlocks for upgrades you have seen before: click the upgrade icon of any squirrel upgrade further down in the tree, then use this button to automatically buy this upgrade and all squirrel upgrades required to reach this one (including all of gated stages), if you can afford it. This avoid having to click every individual upgrade again after respec.\n    <br><br>\n    Planting and upgrading nuts crops cost spores instead of seeds. They work with automaton just like most other crops. If the automaton is spending too much spores on nuts upgrades and you want the tree to level up instead, decrease the allowed % setting for nuts upgrades in the automaton settings.\n    ',
oe[4],void 0,[[ed[4],pd[4],ed[4]],[pd[4],Cd[4],Rd[4]],[ed[4],pd[4],ed[4]]]);
CB(36,"Amber","The tree dropped amber!","The tree dropped a piece of amber! From now on, every now and then, the tree can drop amber when it levels up.\n    <br><br>\n    Amber can be used in the new amber tab for various effects.\n    <br><br>\n    Effects:\n    <br>\n    \u2022 Production boost: gives a boost to berries and mushrooms for the entire run, this lasts until next transcension.\n    <br>\n    \u2022 Other effects may unlock later.\n    ",void 0,void 0,void 0);
CB(37,"Combined Seasonal Fruits","You unlocked combined seasonal fruits fusing!","You unlocked fusing of multi-season fruits! Now when you fuse fruits of different seasons, they may form a new fruit that gives the bonus for both seasons. The following combinations work:\n    <br><br>\n    \u2022 Apricot + Pineapple = Mango (spring + summer)\n    <br>\n    \u2022 Pineapple + Pear = Plum (summer + autumn)\n    <br>\n    \u2022 Pear + Medlar = Quince (autumn + winter)\n    <br>\n    \u2022 Medlar + Apricot = Kumquat (winter + spring)\n    <br><br>\n    Other combinations (e.g. Apricot + Pear, or Quince + Plum) don't work and just give a regular apple, or a lowest common denominator seasonal fruit.\n    <br><br>\n    To get these multi-season fruits, fuse fruits as you usually do. All other fusing rules, such as the combining of abilities (and inability to fuse in case of full ability mismatches), work as usual, the change is now some mixed combinations give a new improved multi-season fruit rather than an apple.\n    <br><br>\n    Later, if (and only if) you get the second fruit-mixing squirrel upgrade, you additionally get the following combinations to make the 4-seasons star fruit:\n    <br><br>\n    \u2022 Mango + Quince = Star Fruit (4 seasons)\n    <br>\n    \u2022 Plum + Kumquat = Star Fruit (4 seasons)\n    <br><br>\n    Combinations that don't cover all 4 seasons, such as mango+plum, won't work, it must be one of the combionations listed above.\n    <br><br>\n    Remember, star fruit fusing is not yet available if you just unlocked the first fruit mixing upgrade now, the star fruit requires the second such squirrel upgrade. Now you already know how to prepare for it though.\n    ",
tc[8],void 0,[[uc[1],vc[1],wc[8]],[zc[1],Ac[4],Bc[7]],[Cc[4],Dc[1],Ec[9]]]);CB(38,"Auto prestige","You unlocked auto prestige!","You unlocked auto-prestige for the automaton! This is integrated with auto-unlock: the same cost settings of auto-unlock are used for auto-prestige, and you can use a toggle to enable/disable auto-prestige.",ne[4]);
function DB(){var a=Ia({Aa:!0,title:"Shortcuts"});var b='<b>List of keyboard shortcuts:</b><br/><br/>Note: on mac, ctrl means command instead.<br/><br/> \u2022 <b>number keys "1-9"</b>: by default, select fruit slot (when available). Can be changed in the preferences under "controls" to instead activate weather or change game tabs.<br/> \u2022 <b>"shift" + number keys "1-9"</b>: by default, activate weather (1-3). Can be changed in the preferences under "controls" to instead select fruit slots or change game tabs.<br/> \u2022 <b>"w"</b>: replant watercress on all field tiles that have a watercress remainder, and refresh existing ones. Such a remainder appears for watercress that have been copying from multiple plants, that is, a good copying spot. Copying has diminishing returns if there are multiple watercress anywhere on the map, 1 or 2 is effective (check the seeds/s income to view the effect).<br/> \u2022 <b>"t"</b>: show transcend dialog (if available)<br/> \u2022 <b>"p"</b>: pick (select) or plant (if empty field) crop under mouse cursor (no mouse click required)<br/> \u2022 <b>"d"</b>: delete crop under mouse cursor (no mouse click required, only if this is enabled in preferences)<br/> \u2022 <b>"u"</b>: tier up: replace crop or template under mouse cursor with highest available tier you can afford (no mouse click required)<br/> \u2022 <b>shift + click empty field</b>: plant last planted or unlocked crop type.<br/> \u2022 <b>ctrl + click empty field</b>: plant a watercress (does not affect last planted type for shift key).<br/> \u2022 <b>ctrl + click non-empty field</b>: delete crop, only if this is enabled in preferences.<br/> \u2022 <b>shift + click non-empty field</b>: replace crop, only if this is enabled in preferences.<br/> \u2022 <b>ctrl + shift + click field</b>: tier up: replace crop or template with highest unlocked tier (if enabled in preferences), pick this crop type as last planted, and on empty field, plant highest tier of picked crop type you can afford.<br/> \u2022 <b>shift + click upgrade</b>: buy as many of this upgrade as you can afford.<br/> \u2022 <b>shift + click undo</b>: save the undo state now, rather than load it. This overwrites your undo so eliminates any chance of undoing now. This will also be overwritten again if you do actions a minute later.<br/> \u2022 <b>shift + click save import dialog</b>: import and old savegame, but force paused state, do not run the time, so you get the resources and season at the time of saving rather than with all production during that time added.<br/> \u2022 <b>ctrl + click save import dialog</b>: import and old savegame, but force non-paused state, even if the savegame was saved while paused, this will cause all time between saving and now to be ran.<br/> \u2022 <b>ctrl + click fruit</b>: move fruit between sacrificial and storage slots, if possible.<br/> \u2022 <b>shift + click fruit</b>: same as ctrl + click fruit.<br/> \u2022 <b>shift + click fruit ability upgrade</b>: buy multiple abilities up to 25% of currently available essence.<br/> \u2022 <b>], }, ) or ></b>: select next active fruit. Can be changed in the preferences under "controls" to instead select next game tab.<br/> \u2022 <b>[, {, ( or <</b>: select previous active fruit. Can be changed in the preferences under "controls" to instead select previous game tab.<br/> \u2022 <b>esc</b>: close current dialog. If no dialogs are open, shows main menu.<br/>';lp()&&
(b+='<br/><b>Blueprints:</b><br/><br/> \u2022 <b>"b"</b>: open the blueprint library, when available.<br/> \u2022 <b>"t"</b>: open the transcension dialog, when available.<br/> \u2022 <b>"t" followed by "Enter"</b>: transcend without blueprint.<br/> \u2022 <b>"t" followed by "b"</b>: transcend and open the transcend-with-blueprint dialog.<br/> \u2022 <b>"t" followed by "c"</b>: transcend and open the start-new-challenge dialog.<br/> \u2022 <b>"1" - "9" in blueprint selection dialog</b>: open or use this blueprint<br/> \u2022 <b>shift + click blueprint</b>: immediately plant this blueprint, rather than opening its edit screen.<br/> \u2022 <b>shift + click blueprint "To Field"</b>: plant this blueprint, but let it override non-matching crops. Without shift, it only plants on empty field spots.<br/> \u2022 <b>shift + click squirrel upgrade</b>: when you unlocked this type of upgrades and have respecced at least once: upgrade all upgrades until this one, only available if you can afford it and this upgrade was seen before.<br/>');
a.content.a.innerHTML=b+"<br/><br/>"}
